[package]
name = "icrate"
version = "0.1.0" # Remember to update html_root_url in lib.rs
description = "Bindings to Apple's frameworks"
keywords = ["macos", "ios", "cocoa", "apple", "framework"]
categories = [
    "accessibility",
    "api-bindings",
    "development-tools::ffi",
    "external-ffi-bindings",
    "os::macos-apis",
]
authors.workspace = true
edition.workspace = true
rust-version.workspace = true
repository.workspace = true
license.workspace = true

[lints]
workspace = true

[dependencies]
objc2 = { path = "../objc2", version = "0.5.0", default-features = false, optional = true }
block2 = { path = "../block2", version = "0.4.0", default-features = false, optional = true }
dispatch = { version = "0.2.0", optional = true }

[dev-dependencies]
static_assertions = "1.1.0"

[package.metadata.docs.rs]
default-target = "x86_64-apple-darwin"
features = ["block2", "objc2", "dispatch", "unstable-frameworks-all", "unstable-private", "unstable-docsrs"]

targets = [
    # MacOS
    "x86_64-apple-darwin",
    "aarch64-apple-darwin",
    # "i686-apple-darwin",
    # iOS
    "aarch64-apple-ios",
    "x86_64-apple-ios",
    # "i386-apple-ios",
    # GNUStep
    "x86_64-unknown-linux-gnu",
    "i686-unknown-linux-gnu",
    # Windows
    "x86_64-pc-windows-msvc",
]

[[example]]
name = "basic_usage"
required-features = [
    "unstable-example-basic_usage"
]

[[example]]
name = "delegate"
required-features = [
    "unstable-example-delegate"
]

[[example]]
name = "speech_synthesis"
required-features = [
    "unstable-example-speech_synthesis"
]

[[example]]
name = "nspasteboard"
required-features = [
    "unstable-example-nspasteboard"
]

[[example]]
name = "browser"
required-features = [
    "unstable-example-browser"
]

[[example]]
name = "metal"
required-features = [
    "unstable-example-metal"
]

[features]
default = ["std", "apple"]

# Currently not possible to turn off, put here for forwards compatibility.
std = ["alloc", "objc2?/std", "block2?/std"]
alloc = ["objc2?/alloc", "block2?/alloc"]

# Runtime selection. See `objc-sys` for details.
apple = ["objc2?/apple", "block2?/apple"]
gnustep-1-7 = ["objc2?/gnustep-1-7", "block2?/gnustep-1-7"]
gnustep-1-8 = ["gnustep-1-7", "objc2?/gnustep-1-8", "block2?/gnustep-1-8"]
gnustep-1-9 = ["gnustep-1-8", "objc2?/gnustep-1-9", "block2?/gnustep-1-9"]
gnustep-2-0 = ["gnustep-1-9", "objc2?/gnustep-2-0", "block2?/gnustep-2-0"]
gnustep-2-1 = ["gnustep-2-0", "objc2?/gnustep-2-1", "block2?/gnustep-2-1"]

# Deprecated.
objective-c = ["objc2"]

# Deprecated.
block = ["block2"]

# For better documentation on docs.rs
unstable-docsrs = []

# Private framework functionality
#
# These functions/methods are all marked `unsafe`, since they may not always
# exist.
unstable-private = []

# Make the `ns_string!` macro create the string statically.
#
# Please test it, and report any issues you may find:
# https://github.com/madsmtm/objc2/issues/new
unstable-static-nsstring = []

# Examples

